import styled from "styled-components";

const SummaryContainer=styled.section`
background-color:red;
width:50%;
margin:0 auto;
padding:40px;
// display:block;
border:2px solid black;
text-align:center;
margin-top: -15rem;
    position: relative;
    background-color: #383838;
    color: white;
    border-radius: 14px;

& h2{
    text-align:center;
    font-size: 2rem;
    margin-top: 0;
    // margin-bottom:10px;
}
`

export {SummaryContainer}
